    false,nt"url": null,nt"notes": "Sediment Data Analytical results for sediment
    samples collected from the unnamed creek and "clean" Delaware background areas
    are compared to ER-M levels in Table 1. The ER-M is the 50th percentile concentration
    associated with adverse biological effects (Long and Morgan 1990). The ER-M is defined
    as the concentration above which toxic effects usually or frequently occur. Concentrations
    of all metals detected in the unnamed creek sediment samples were less than ER-M
    levels (Long and Morgan 1990) (Table 1). Two of four sediment samples from the unnamed
    creek contained p,p'-DDD concentrations that exceeded the ER-M value of 0.020 ppm.
    Because no DDE or DDT were found in sediments, the ER-M for total DDT (the sum of
    DDT, DDD, and DDE) of 0.35 ppm was not exceeded. The mean concentration for the
    two samples with detectable levels of p,p'-DDD was 0.057 ppm. While total PAH's
    did not exceed the ER-M value, one naturally occurring PAH, perylene, was found
    to exceed apparent effects thresholds (AET) for amphipods (0.23 ppm) and bivalve
    larvae (0.095 ppm) (Long and Morgan 1990). The AET is a concentration above which
    statistically significant biological effects always occur. The mean perylene concentration
    was 0.341 ppm with two out of four samples exceeding the amphipod AET and all four
    samples exceeding the bivalve larvae AET. There is no ER-M value for perylene at
    this time.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
